import React from "react";


const Recipe= (allRecipes)=>{

    return (
        <React.Fragment>
           { 
            allRecipes.map(r=>(
                <ul key={r.id}>
                    {r.name}, {r.image}, {r.diets}
                </ul>
            ))
           }
        </React.Fragment>
    )
}

export default Recipe;
